import React from 'react';
import { portfolioData } from '../data/portfolioData';

const Achievements = () => {
  // Function to handle click and open image/PDF in same tab
  const handleItemClick = (item) => {
    if (item.type === 'pdf' && item.pdfUrl) {
      // Open PDF in same tab
      window.open(item.pdfUrl, '_self');
    } else if (item.image) {
      // Open image in same tab
      window.open(item.image, '_self');
    }
  };

  return (
    <section id="achievements" className="py-20 bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="text-center mb-16">
          <h2 className="text-4xl font-bold text-gray-900 mb-4">Achievements & Certificates</h2>
          <div className="w-24 h-1 bg-primary mx-auto mb-4"></div>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Recognition and certifications that showcase my dedication to continuous learning
          </p>
        </div>

        {/* Certificates Section */}
        <div className="mb-16">
          <h3 className="text-2xl font-bold text-gray-900 mb-8 text-center">Certifications</h3>
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {portfolioData.certificates.map((certificate, index) => (
              <div
                key={index}
                onClick={() => handleItemClick(certificate)}
                className="bg-white rounded-xl shadow-md overflow-hidden border-2 border-primary/10 cursor-pointer transition-all duration-300 active:scale-95"
              >
                <div className="h-48 bg-gradient-to-br from-blue-50 to-primary/10 relative overflow-hidden flex items-center justify-center">
                  <div className="text-center p-4">
                    <div className="w-16 h-16 bg-primary/20 rounded-full flex items-center justify-center mx-auto mb-4">
                      <span className="text-2xl">📜</span>
                    </div>
                    <h3 className="text-lg font-semibold text-gray-900 mb-2">{certificate.title}</h3>
                    <p className="text-sm text-gray-600 mb-2">{certificate.organization}</p>
                    <p className="text-xs text-primary font-medium">{certificate.duration}</p>
                  </div>
                  {/* Click indicator */}
                  <div className="absolute bottom-4 left-1/2 transform -translate-x-1/2 bg-primary text-white text-xs px-3 py-1 rounded-full">
                    Click to Open
                  </div>
                </div>
                
                <div className="p-6 border-t border-gray-100">
                  <div className="flex justify-between items-center mb-3">
                    <span className="text-primary font-medium text-sm">{certificate.date}</span>
                    {certificate.grade && (
                      <span className="bg-green-100 text-green-800 text-xs font-medium px-2 py-1 rounded">
                        Grade: {certificate.grade}
                      </span>
                    )}
                  </div>
                  <p className="text-gray-600 text-sm">{certificate.description}</p>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Achievement Photos Section */}
        <div>
          <h3 className="text-2xl font-bold text-gray-900 mb-8 text-center">Achievement Moments</h3>
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {portfolioData.achievements.map((achievement, index) => (
              <div
                key={index}
                onClick={() => handleItemClick(achievement)}
                className="bg-white rounded-xl shadow-md overflow-hidden cursor-pointer transition-all duration-300 active:scale-95"
              >
                <div className="h-64 bg-gradient-to-br from-primary to-accent relative overflow-hidden">
                  <img
                    src={achievement.image}
                    alt={achievement.title}
                    className="w-full h-full object-cover"
                  />
                  <div className="absolute inset-0 bg-black/40"></div>
                  <div className="absolute top-4 right-4 bg-white/90 backdrop-blur-sm rounded-full w-12 h-12 flex items-center justify-center">
                    <span className="text-primary text-xl">🏆</span>
                  </div>
                  {/* Click indicator */}
                  <div className="absolute bottom-4 left-1/2 transform -translate-x-1/2 bg-white text-primary text-xs px-3 py-1 rounded-full font-medium">
                    Click to Open
                  </div>
                </div>
                
                <div className="p-6">
                  <h3 className="text-lg font-semibold text-gray-900 mb-2">
                    {achievement.title}
                  </h3>
                  <div className="flex justify-between items-center mb-3">
                    <span className="text-primary font-medium text-sm">{achievement.year}</span>
                    <span className="text-gray-500 text-sm">{achievement.description}</span>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Stats Section REMOVED - Yeh hata diya */}
      </div>
    </section>
  );
};

export default Achievements;
